import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
    <div className="container" style={{
        backgroundColor:"red",
        height: "90vh",
        width: "50vw",
        margin: "auto",
        marginTop: "20px",
        padding: "10px",
        borderRadius: "5px",
      }}>
      <h2>내 일주일 평가</h2>
      <div className="daylist" style={{
        display:"flex"
      }}>월요일
        <div style={{
            width: "30px",
            height: "30px",
            borderRadius: "30px",
            margin: "5px",
            backgroundColor:
            "rgb(255, 235, 59)"
          }}>
          </div>
          <div className="greyCircle" style={{
            width: "30px",
            height: "30px",
            borderRadius: "30px",
            margin: "5px",
            backgroundColor: "rgb(221, 221, 221)"
          }}>
          <div className="greyCircle" style={{
            width: "30px",
            height: "30px",
            borderRadius: "30px",
            margin: "5px",
            backgroundColor: "rgb(221, 221, 221)"
          }}></div>
          <div className="greyCircle" style={{
            width: "30px",
            height: "30px",
            borderRadius: "30px",
            margin: "5px",
            backgroundColor: "rgb(221, 221, 221)"
          }}></div>
          <div className="greyCircle" style={{
            width: "30px",
            height: "30px",
            borderRadius: "30px",
            margin: "5px",
            backgroundColor: "rgb(221, 221, 221)"
          }}></div>
          </div>
        </div>
      </div> 
    </div>
  );
}

export default App;
